import {Component, OnInit} from '@angular/core';
import {FormBuilder, FormsModule, ReactiveFormsModule, Validators} from "@angular/forms";
import {SelectionComponent} from "../../../../base/selection/selection.component";
import {ActivatedRoute, Router} from "@angular/router";
import {NgIf} from "@angular/common";
import {DomSanitizer} from "@angular/platform-browser";

@Component({
  selector: 'app-save-advertisement',
  standalone: true,
  imports: [
    FormsModule,
    ReactiveFormsModule,
    SelectionComponent,
    NgIf
  ],
  templateUrl: './save-advertisement.component.html',
  styleUrl: './save-advertisement.component.scss'
})
export class SaveAdvertisementComponent implements OnInit {
  formSave: any;
  action: any = 'CREATE';
  previewImages: any;

  inmageUpdate = '';

  constructor(private fb: FormBuilder,
              private route: ActivatedRoute,
              private router: Router,
              private sanitizer: DomSanitizer,
  ) {
  }


  ngOnInit(): void {
    this.route.params.subscribe(params => {
      const param = params['id'];
      console.log(params, param)
    });



    this.formSave = this.fb.group({
      name: ['', [Validators.required]],
      fromDate: [''],
      toDate: [''],
      location: [''],
      deviceName: [''],
      locationDisplay: [''],
      block: [''],
      imageName: [''],
      image: [''],
      displayOrder: ['']
    })

    if(this.router.url.includes('/update/')){
      this.action = 'UPDATE';
      this.previewImages = this.sanitizer.bypassSecurityTrustResourceUrl(`data:image/png;base64, ${this.inmageUpdate}`);
      console.log(this.inmageUpdate);
      this.formSave.patchValue({imageName: 'chunghh.jpg'})
      // this.onUpdateFile(this.inmageUpdate, 'chunghh.jpg');
    }
  }

  // onUpdateFile(content: any, name: any) {
  //   const fileFromServer = new File([`data:image/png;base64 + ${content}`], name);
  //   this.formSave.patchValue({
  //     image: fileFromServer
  //   })
  // }


  onCreate() {

    console.log(this.formSave.value)

  }

  onUpdate() {
    console.log(this.formSave.value)

  }

  onFileChange($event: any) {

    const selectedFiles = $event.target.files;

    if (selectedFiles) {
      const file: File | null = selectedFiles.item(0);

      if (file) {
        this.previewImages = '';

        const reader = new FileReader();

        reader.onload = (e: any) => {
          console.log(e.target.result);
          this.previewImages = e.target.result;
        };

        reader.readAsDataURL(file);
      }
    }
  }



}
